const init={islogged:false,user:''}
const UserReducer=(state=init,action)=>
{
    
    switch(action.type)
    {
        case "SET_LOG":
            return{
            ...state,islogged:!state.islogged
            }
            
        default:
            return state;
    }

}

export default UserReducer;
